// Import statements
import React from 'react';

const StickyNavbar = () => {
  const navList = (
    <ul className="col-start-3 col-end-10 flex justify-between">
      <li className="p-1 font-normal text-blue-gray-700">
        <a href="#!" className="flex items-center hover:text-blue-500">
          AB Calculator
        </a>
      </li>

      <li className="p-1 font-normal text-blue-gray-700">
        <a href="#!" className="flex items-center hover:text-blue-500">
          About me
        </a>
      </li>
    </ul>
  );

  return (
    <div className="w-full">
      <nav className="sticky top-0 z-10 h-max max-w-full bg-white shadow-md">
        <div className="px-20">
          <div className="mx-auto max-w-[1440px]">
            <div className="grid grid-cols-12 gap-6">
              {navList}
            </div>
          </div>
        </div>
      </nav>
    </div>

  );
}

export default StickyNavbar;
